
DROP DATABASE IF EXISTS project_management;
CREATE DATABASE IF NOT EXISTS project_management;
USE project_management;


#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `first_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя пользователя',
  `last_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Фамилия пользователя',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Почта',
  `password` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Пароль',
  `is_logged_in` tinyint(1) NOT NULL COMMENT 'пользователь авторизован?',
  `avatar` bigint(20) DEFAULT NULL COMMENT 'Аватар',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Пользователи';




#
# TABLE STRUCTURE FOR: units
#

DROP TABLE IF EXISTS `units`;

CREATE TABLE `units` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя юнита',
  `type` enum('company','team','project') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'тип юнита (компания, команда или проект)',
  `details` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`details`)),
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Команды';



#
# TABLE STRUCTURE FOR: users_units
#

DROP TABLE IF EXISTS `users_units`;

CREATE TABLE `users_units` (
  `user_id` bigint(20) unsigned NOT NULL COMMENT 'Пользователь',
  `unit_id` bigint(20) unsigned NOT NULL COMMENT 'Юнит',
  PRIMARY KEY (`user_id`,`unit_id`),
  KEY `users_units_unit_id_fk` (`unit_id`),
  CONSTRAINT `users_units_unit_id_fk` FOREIGN KEY (`unit_id`) REFERENCES `units` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `users_units_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='связь пользователей и юнитов';




#
# TABLE STRUCTURE FOR: users_events
#

#
# TABLE STRUCTURE FOR: chats
#

DROP TABLE IF EXISTS `chats`;

CREATE TABLE `chats` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `target_type` enum('unit','user') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'тип чата',
  `target_id` bigint(20) unsigned NOT NULL COMMENT 'идентификатор',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='таблица чатов';



#
# TABLE STRUCTURE FOR: chats_users
#

DROP TABLE IF EXISTS `chats_users`;

CREATE TABLE `chats_users` (
  `chat_id` bigint(20) unsigned NOT NULL COMMENT 'Чат',
  `user_id` bigint(20) unsigned NOT NULL COMMENT 'Пользователь',
  PRIMARY KEY (`chat_id`,`user_id`),
  KEY `chats_users_user_id_fk` (`user_id`),
  CONSTRAINT `chats_users_chat_id_fk` FOREIGN KEY (`chat_id`) REFERENCES `chats` (`id`) ON DELETE CASCADE,
  CONSTRAINT `chats_users_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='связь чатов и пользователей';



#
# TABLE STRUCTURE FOR: comments
#

CREATE TABLE `comments` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `target_type` enum('todo_list','todo','post','event','doc') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Тип элемента для комментария',
  `target_id` bigint(20) unsigned NOT NULL COMMENT 'Идентификатор элемента',
  `creator_id` bigint(20) unsigned NOT NULL COMMENT 'Автор сообщения',
  `body` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'текс сообщения',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `comments_creator_id_fk` (`creator_id`),
  CONSTRAINT `comments_creator_id_fk` FOREIGN KEY (`creator_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='таблица комментариев';




#
# TABLE STRUCTURE FOR: documents
#

DROP TABLE IF EXISTS `documents`;

CREATE TABLE `documents` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор поста',
  `creator_id` bigint(20) unsigned NOT NULL COMMENT 'Автор поста',
  `unit_id` bigint(20) unsigned NOT NULL COMMENT 'Юнит',
  `type` enum('document','file') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `head` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Заголовок документа',
  `body` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Текст',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `documents_creator_id_fk` (`creator_id`),
  KEY `documents_unit_id_fk` (`unit_id`),
  CONSTRAINT `documents_creator_id_fk` FOREIGN KEY (`creator_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `documents_unit_id_fk` FOREIGN KEY (`unit_id`) REFERENCES `units` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Посты';




#
# TABLE STRUCTURE FOR: events
#

DROP TABLE IF EXISTS `events`;

CREATE TABLE `events` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `unit_id` bigint(20) unsigned NOT NULL COMMENT 'Идентификатор юнита',
  `creator_id` bigint(20) unsigned NOT NULL COMMENT 'автор сообщения',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Название события',
  `details` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `repeat` tinyint(1) DEFAULT NULL COMMENT 'Нужно ли повторять событие',
  `repeat_interval` time DEFAULT NULL COMMENT 'Периодичность повторения',
  `repeat_until` datetime DEFAULT NULL COMMENT 'Дата окончанию для повторения',
  `starts_at` datetime NOT NULL COMMENT 'Дата начала события',
  `ends_at` datetime DEFAULT NULL COMMENT 'Дата окончания события',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `events_unit_id_fk` (`unit_id`),
  KEY `events_creator_id_fk` (`creator_id`),
  CONSTRAINT `events_creator_id_fk` FOREIGN KEY (`creator_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `events_unit_id_fk` FOREIGN KEY (`unit_id`) REFERENCES `units` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='События';



#
# TABLE STRUCTURE FOR: media
#

DROP TABLE IF EXISTS `media`;

CREATE TABLE `media` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `creator_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Идентификатор пользователя',
  `target_type` enum('comment','document','event','post','todo_list','todo','user') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'тип данных',
  `target_id` bigint(20) unsigned NOT NULL COMMENT 'Идентификатор элемента',
  `media_type` enum('photo','video','audio') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'тип данных',
  `filename` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Ссылка на файл',
  `size` bigint(20) unsigned DEFAULT NULL COMMENT 'Размер файла',
  `metadate` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Метаданные' CHECK (json_valid(`metadate`)),
  PRIMARY KEY (`id`),
  KEY `media_creator_id_fk` (`creator_id`),
  CONSTRAINT `media_creator_id_fk` FOREIGN KEY (`creator_id`) REFERENCES `users` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Медиаданные';



#
# TABLE STRUCTURE FOR: messages
#

DROP TABLE IF EXISTS `messages`;

CREATE TABLE `messages` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `chat_id` bigint(20) unsigned NOT NULL COMMENT 'Идентификатор чата',
  `creator_id` bigint(20) unsigned NOT NULL COMMENT 'Автор сообщения',
  `body` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'текс сообщения',
  `is_delivered` tinyint(1) DEFAULT NULL COMMENT 'Статус доставки',
  `is_read` tinyint(1) DEFAULT NULL COMMENT 'Статус получения)',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `messages_chat_id_fk` (`chat_id`),
  KEY `messages_creator_id_fk` (`creator_id`),
  CONSTRAINT `messages_chat_id_fk` FOREIGN KEY (`chat_id`) REFERENCES `chats` (`id`) ON DELETE CASCADE,
  CONSTRAINT `messages_creator_id_fk` FOREIGN KEY (`creator_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='таблица чатов';




#
# TABLE STRUCTURE FOR: post_categories
#

DROP TABLE IF EXISTS `post_categories`;

CREATE TABLE `post_categories` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Название категории',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Категории постов';



#
# TABLE STRUCTURE FOR: posts
#

DROP TABLE IF EXISTS `posts`;

CREATE TABLE `posts` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор поста',
  `creator_id` bigint(20) unsigned NOT NULL COMMENT 'Автор поста',
  `unit_id` bigint(20) unsigned NOT NULL COMMENT 'Юнит',
  `category_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Ссылка на категории поста',
  `head` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Заголовок поста',
  `body` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Текст поста',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `posts_unit_id_fk` (`unit_id`),
  KEY `posts_creator_id_fk` (`creator_id`),
  KEY `posts_category_id_fk` (`category_id`),
  CONSTRAINT `posts_category_id_fk` FOREIGN KEY (`category_id`) REFERENCES `post_categories` (`id`) ON DELETE SET NULL,
  CONSTRAINT `posts_creator_id_fk` FOREIGN KEY (`creator_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `posts_unit_id_fk` FOREIGN KEY (`unit_id`) REFERENCES `units` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Посты';



#
# TABLE STRUCTURE FOR: profiles
#

DROP TABLE IF EXISTS `profiles`;

CREATE TABLE `profiles` (
  `user_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Ссылка на пользователя',
  `gender` enum('m','f') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Пол',
  `birthday` date DEFAULT NULL COMMENT 'Дата рождения',
  `division` varchar(130) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Подразделение',
  `position` varchar(130) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Должность',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`user_id`),
  CONSTRAINT `profiles_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Профили';



#
# TABLE STRUCTURE FOR: todo_lists
#

DROP TABLE IF EXISTS `todo_lists`;

CREATE TABLE `todo_lists` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `unit_id` bigint(20) unsigned NOT NULL COMMENT 'Идентификатор юнита',
  `creator_id` bigint(20) unsigned NOT NULL COMMENT 'создатель списка',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Название списка',
  `details` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Детали списка задач',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `todo_lists_unit_id_fk` (`unit_id`),
  KEY `todo_lists_creator_id_fk` (`creator_id`),
  CONSTRAINT `todo_lists_creator_id_fk` FOREIGN KEY (`creator_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `todo_lists_unit_id_fk` FOREIGN KEY (`unit_id`) REFERENCES `units` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Список задач';




#
# TABLE STRUCTURE FOR: todos
#

DROP TABLE IF EXISTS `todos`;

CREATE TABLE `todos` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `todo_list_id` bigint(20) unsigned NOT NULL COMMENT 'Идентификатор задачи',
  `creator_id` bigint(20) unsigned NOT NULL COMMENT 'создатель задачи (может отличаться от создателя списка)',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Название события',
  `details` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Детали задачи',
  `starts_at` datetime NOT NULL COMMENT 'Дата начала события',
  `ends_at` datetime DEFAULT NULL COMMENT 'Дата окончания события',
  `is_done` tinyint(1) DEFAULT NULL COMMENT 'Состояние',
  `notify_assignment` tinyint(1) DEFAULT NULL COMMENT 'Уведомить о назначении задачи ответственных пользователей',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `todos_todo_list_id_fk` (`todo_list_id`),
  KEY `todos_creator_id_fk` (`creator_id`),
  CONSTRAINT `todos_creator_id_fk` FOREIGN KEY (`creator_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `todos_todo_list_id_fk` FOREIGN KEY (`todo_list_id`) REFERENCES `todo_lists` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='События';



#
# TABLE STRUCTURE FOR: todo_notify
#

DROP TABLE IF EXISTS `todo_notify`;

CREATE TABLE `todo_notify` (
  `todo_id` bigint(20) unsigned NOT NULL COMMENT 'Список задач',
  `user_id` bigint(20) unsigned NOT NULL COMMENT 'Пользователь',
  PRIMARY KEY (`todo_id`,`user_id`),
  KEY `todo_notify_user_id_fk` (`user_id`),
  CONSTRAINT `todo_notify_todo_id_fk` FOREIGN KEY (`todo_id`) REFERENCES `todos` (`id`) ON DELETE CASCADE,
  CONSTRAINT `todo_notify_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Назначение задач пользователям';




#
# TABLE STRUCTURE FOR: todos_assigned_to
#

DROP TABLE IF EXISTS `todos_assigned_to`;

CREATE TABLE `todos_assigned_to` (
  `todo_id` bigint(20) unsigned NOT NULL COMMENT 'Список задач',
  `user_id` bigint(20) unsigned NOT NULL COMMENT 'Пользователь',
  PRIMARY KEY (`todo_id`,`user_id`),
  KEY `todos_assigned_to_user_id_fk` (`user_id`),
  CONSTRAINT `todos_assigned_to_todo_id_fk` FOREIGN KEY (`todo_id`) REFERENCES `todos` (`id`) ON DELETE CASCADE,
  CONSTRAINT `todos_assigned_to_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Назначение задач пользователям';



#
# TABLE STRUCTURE FOR: users_events
#


DROP TABLE IF EXISTS `users_events`;

CREATE TABLE `users_events` (
  `user_id` bigint(20) unsigned NOT NULL COMMENT 'Пользователь',
  `event_id` bigint(20) unsigned NOT NULL COMMENT 'Событие',
  PRIMARY KEY (`user_id`,`event_id`),
  KEY `users_events_event_id_fk` (`event_id`),
  CONSTRAINT `users_events_event_id_fk` FOREIGN KEY (`event_id`) REFERENCES `events` (`id`) ON DELETE CASCADE,
  CONSTRAINT `users_events_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='связь событий и пользователей';




